import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [resp, setResp] = useState([])

  fetch('https://jsonplaceholder.typicode.com/todos/1')
        .then(response => {
          return response.json()
        })
        .then(json => setResp(json))
        .catch(e => console.log(e))
console.log
  return (
    <div className="App">

    </div>
  );
}

export default App;
